import React, { memo } from "react";

import { HeaderWrapper } from "./style";

export default memo(function HYThemeHeaderAlbum(props) {
  const { title, subtitle } = props;

  const wrapper = `
    <a>全部</a>
    <span>|</span>
    <a>华语</a>
    <span>|</span>
    <a>欧美</a>
    <span>|</span>
    <a>韩国</a>
    <span>|</span>
    <a>日本</a>
  `;

  return (
    <HeaderWrapper>
      <div className="title">{title}</div>
      <div className="right">{subtitle}</div>
    </HeaderWrapper>
  );
});
